	strcpy(tmp.ts_pos,"");
	strcpy(tmp.ts_utc_time_ubx,"");
    strcpy(tmp.ts_utc_time_nmea,"");
	strcpy(tmp.ts_acc,"");
	strcpy(tmp.ts_att,"");
	strcpy(tmp.ts_alt,"");
    strcpy(tmp.ts_comp_acc,"");
    strcpy(tmp.ts_comp_ang_rate,"");
	strcpy(tmp.ts_sog_cog_ubx,"");
	strcpy(tmp.ts_sog_cog_nmea,"");
	strcpy(tmp.fix_ubx,"");
	strcpy(tmp.fix_nmea,"");
